import time
def calcExcutionTime(func):
    def wrapper(*args, **kwargs):
        before = time.time()
        output = func(*args, **kwargs)
        print(str(time.time() - before) + "seconds")
        return output
        
    return wrapper

#  my solve
@calcExcutionTime
def group_anagrams(strings):
    anagrams = {}
    groubed_anagrams = {}
    word_letters_dict = {}

    for txt in strings:
        is_in_any_anagram = False
        for i, (k, word_letters) in enumerate(anagrams.items()):
            is_in_this_anagrams = True
            for letter in word_letters:
                word_letters_dict.update(letter)
            for l in txt:
                if word_letters_dict.get(l) is None:
                    is_in_this_anagrams = False
                    break
            if(is_in_this_anagrams):
                groubed_anagrams[k].append(txt)
                is_in_any_anagram = True
                break

        if(not is_in_any_anagram):
            new_word_letters_dict = ({letter: True} for letter in txt)
            anagrams[txt] = new_word_letters_dict
            groubed_anagrams[txt] = [txt]
    
    
    output = []
    for item in  groubed_anagrams:
        output.append(groubed_anagrams[item])
    return output

# searched solve
@calcExcutionTime
def group_anagrams2(strings):
    anagram_groups = {}
    for string in strings:
        canonical = ''.join(sorted(string))
        if canonical in anagram_groups:
            anagram_groups[canonical].append(string)
        else:
            anagram_groups[canonical] = [string]
    return list(anagram_groups.values())



